    //     device: device,
    //     type: configtype.type,
    //     TDS: configtype.TDS,
    //     dead_TDS: configtype.dead_TDS,
    //     PH: configtype.PH,
    //     dead_PH: configtype.dead_PH,
    //     nutri_Ratio: configtype.nutri_Ratio,
    //   });
    // } catch (error) {
    //   console.log(error);
    // }
  };

  return (
    <div>
      <OverlayTrigger
        placement="left"
        overlay={<Tooltip>Choose this type for current config</Tooltip>}
      >
        <form onSubmit={onClickConf}>
          <button type="submit" onClick={choosePostType.bind(this, type)}>
            <img src={selectButton} width="30" height="30" />
          </button>
        </form>
      </OverlayTrigger>
    </div>
  );
};
export default PostButtonTypeModal;
